import React from "react";
import { Box, Grid, Typography, Button, makeStyles } from "@material-ui/core";

const skills = ["Javascript", "React.js", "Node.js"]

const useStyles = makeStyles({
  wrapper: {
    border: '1px solid #e8e8e8',

  }
})

export default (props) => {
  const classes = useStyles()
  return(
    <Box p={2} className={classes.wrapper}>
      <Grid container justify="center">
        <Grid item xs>
          <Typography variant="subtitle1">Frontend</Typography>
          <Typography variant="subtitle2">Google</Typography>
        </Grid>
        <Grid  container item xs>
          {skills.map(skill => <Grid item key={skill}>{skill}</Grid>)}
        </Grid>
        <Grid item container xs direction="column" alignItems="flex-end">
          <Grid item>
            <Typography variant="caption">
              2577 min ago | Full-Time
            </Typography>
          </Grid>
          <Grid item>
            <Box mt={2}>
              <Button variant="outlined">Check</Button>
            </Box>
          </Grid>
        </Grid>
      </Grid>
    </Box>
  )
}
